import React from "react";

// reactstrap components
import {
  Badge,
  Card,
  CardHeader,
  CardFooter,
  DropdownMenu,
  Button,
  DropdownItem,
  UncontrolledDropdown,
  DropdownToggle,
  Media,
  Pagination,
  PaginationItem,
  Form,
  FormGroup,
  InputGroupAddon,
  InputGroupText,
  Input,
  InputGroup,
  Navbar,
  Nav,
  PaginationLink,
  Progress,
  Table,
  Container,
  Row,
  UncontrolledTooltip,
} from "reactstrap";

// core components
import TrendsHeader from "components/Headers/TrendsHeader.js";
import Login from './examples/googleLogin';
import {Redirect} from 'react-router-dom';

var trendsData = {};

class TiktokTrends extends React.Component {

  constructor() {
    super();
    this.state = {
      hashtags: [],
      musics: [],
      topMusic: {info: {title: "--"}, musicDesc: ""},
      topHashtag: {info: {title: "--"}, viewDesc: ""}
    };
  }

  onSubmit = () => {
      this.props.history.push('/login/');
  }

  componentDidMount() {
    fetch('http://ec2-18-117-197-197.us-east-2.compute.amazonaws.com:8100/discover')
      .then((response) => response.json())
      .then((responseJson) => {
        this.setState({
          hashtags: responseJson.data.hashtags,
          musics: responseJson.data.musics,
          topMusic: responseJson.data.top_music,
          topHashtag: responseJson.data.top_hashtag});
      })
      .catch((error) => {
        console.error(error);
      });
  }

  copyClicked(text) {
    alert("Item copied " + text);
  }

  render() {

    return (
      <>
      <div className="pt-7">
          <Form className="navbar-search navbar-search-dark form-inline mr-3 d-none d-md-flex ml-lg-auto" style={{ justifyContent: 'center'}}>
              <FormGroup className="">
                  <InputGroup className="input-group-alternative">
                      <InputGroupAddon addonType="prepend">
                          <InputGroupText style={{color:'black'}}>
                              <i style={{color:'black'}} className="fas fa-search"/>
                          </InputGroupText>
                      </InputGroupAddon>
                      <Input placeholder="Search" style = {{ fontFamily: 'Avenir', color:'black'}} type="text"/>
                  </InputGroup>
              </FormGroup>
          </Form>

          <Container fluid className="header pt-8">
              <Container className="mt--7"  fluid>
                <Row>
                  <div className="col">
                    <Card className="shadow">
                      <Row style={{ textAlign: 'center', paddingTop: "20px"}}>
                        <h2 className=" text-muted " style={{paddingLeft: "20px"}}> Your Watchlist </h2>
                        <div className="col text-right" style={{paddingBottom:"2%"}}>
                          <Button
                            color="primary"
                            href="admin/Analytics"
                            size="sm"
                            href="/admin/Analytics"
                          >
                            See all
                          </Button>
                        </div>
                      </Row>
                      <Table className="align-items-center table-flush" responsive>
                        <thead className="thead-light">
                          <tr>
                            <th scope="col">Item</th>
                            <th scope="col">Number of Views</th>
                            <th scope="col">Description</th>
                            <th scope="col">Link</th>
                            <th scope="col" />
                          </tr>
                        </thead>
                        <tbody>
                        </tbody>
                      </Table>
                    </Card>
                  </div>
                </Row>
              </Container>
            </Container>
        </div>
      </>
    );
  }
}

export default TiktokTrends;
